const SectionList = (props) => {
  const { sections } = props

  return (
    <Card className="my-3 p-3 rounded">
      {sections.map((section, index) => (
        <Link to={`/yoga${sections._id}`} key="index">
          <Card.Img src={product.image} variant="top" />
        </Link>
      ))}
    </Card>
  )
}

export default Section
